&quot;Egentligen far de ner till hamnen i Trondheim f&amp;ouml;r att kolla runt lite i efterdyningarna av ett fyllemord, men pl&amp;ouml;tsligt f&amp;aring;r en vakthund span och nosar fram tre kvinnor som ligger nerkastade i en container. 
Kvinnorna &amp;auml;r tungt drogade, &amp;ouml;verlassade med byggskrot och illa tilltygade men &amp;aring;tminstone en av dem lever. 
Vilka &amp;auml;r de, var kommer de ifr&amp;aring;n och vem var grym nog att l&amp;auml;mna dem d&amp;auml;r?

Det &amp;auml;r bara en av kvinnorna som &amp;ouml;verlever - men i skr&amp;auml;ck f&amp;ouml;r den/de som har l&amp;auml;mnat henne i containern flyr hon sjukhuset i vild panik s&amp;aring; snart hon kan st&amp;aring; p&amp;aring; benen. Hon stj&amp;auml;l ihop lite kl&amp;auml;der och irrar runt, hon har ingen aning om var hon &amp;auml;r. En vild jakt tar vid och Anne-kin h&amp;aring;ller naturligtvis p&amp;aring; att r&amp;aring;ka rej&amp;auml;lt illa ut ett par g&amp;aring;nger sj&amp;auml;lv innan g&amp;aring;tan f&amp;aring;r sin l&amp;ouml;sning.&quot;




&quot;I live in my own little world...but it's ok...they know me here...&quot;
